DELIMITER $$
CREATE TRIGGER `after_delete_jadwal` AFTER DELETE ON `jadwal` FOR EACH ROW BEGIN
  DECLARE count_rows INT;

  -- Periksa apakah masih ada data yang mengacu pada id_alokasi di tabel detail
  SELECT COUNT(*) INTO count_rows
  FROM jadwal
  WHERE idsem = OLD.idsem AND nama_prodi = OLD.nama_prodi;

