DELIMITER $$
CREATE TRIGGER `insert_alokasi_jadwal_after_semester_insert` AFTER INSERT ON `semester` FOR EACH ROW BEGIN
    -- Deklarasi variabel untuk iterasi
    DECLARE done INT DEFAULT 0;
    DECLARE v_nama_prodi VARCHAR(20);
    DECLARE v_id_jadwal_prodi VARCHAR(20);

    -- Deklarasi cursor untuk membaca nama_prodi dari tabel prodi
    DECLARE cur_prodi CURSOR FOR SELECT nama_prodi FROM prodi;
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;

    -- Buka cursor
    OPEN cur_prodi;

    -- Loop untuk iterasi setiap record di tabel prodi
    read_loop: LOOP
        FETCH cur_prodi INTO v_nama_prodi;
        IF done THEN
            LEAVE read_loop;
        END IF;

        -- Buat ID untuk jadwal_prodi
        SET v_id_jadwal_prodi = CONCAT('J-', NEW.idsem, '-', SUBSTRING(v_nama_prodi, 1, 3));

        -- Tambahkan record baru ke tabel jadwal_prodi
        INSERT INTO jadwal_prodi (id_jadwal_prodi, idsem, nama_prodi, status)
        VALUES (v_id_jadwal_prodi, NEW.idsem, v_nama_prodi, 'belum diisi');
    END LOOP;

    -- Tutup cursor
    CLOSE cur_prodi;
END
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `insert_alokasi_ruang_after_semester_insert` AFTER INSERT ON `semester` FOR EACH ROW BEGIN
    -- Declare variables to store the results of the `prodi` table query
    DECLARE done INT DEFAULT 0;
    DECLARE v_nama_prodi VARCHAR(20);
    DECLARE v_id_alokasi VARCHAR(20);
    DECLARE cur CURSOR FOR SELECT nama_prodi FROM prodi;
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;

    -- Open the cursor to loop through each `nama_prodi`
    OPEN cur;

    -- Loop through all rows in `prodi` table and insert into `alokasi_ruang`
    read_loop: LOOP
        FETCH cur INTO v_nama_prodi;
        IF done THEN
            LEAVE read_loop;
        END IF;

        -- Generate the id_alokasi using the format AR-{idsem}-{first_three_letters_of_nama_prodi}
        SET v_id_alokasi = CONCAT('AR-', NEW.idsem, '-', SUBSTRING(v_nama_prodi, 1, 3));

        -- Insert into the `alokasi_ruang` table for each `nama_prodi`
        INSERT INTO alokasi_ruang (id_alokasi, idsem, nama_prodi, status)
        VALUES (v_id_alokasi, NEW.idsem, v_nama_prodi, 'belum diisi');
    END LOOP;

    -- Close the cursor
    CLOSE cur;
END
$$
DELIMITER ;

